import React from 'react';
import classes from './GeneralContentDiv.module.css';
import base from '../../CommonAppUtilities/AppContentDiv.module.css';
import DashboardContentDiv from './DashboardContentDiv';
import secbar from './SectionBar.module.css';

const GeneralContentDiv=()=>{




return (

<div className={base.appContentDiv}>
   <div className={classes.contentDiv}>

       <div className={secbar.sectionBar}>

             <div className={secbar.noticeBoardTitle}> <b>Notice Board</b></div>
             <div className={secbar.classesAndCoursesTitle}> <b>Classes and Courses</b> </div>
       </div>










      <DashboardContentDiv/>

   </div>
</div>	

);

}


export default GeneralContentDiv;
